import React, { Component, useContext } from "react";
import "./App.css";
import AppContextProvider from "./contexts/global";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <AppContextProvider value={this.props}>
          <h1>hi</h1>
        </AppContextProvider>
      </React.Fragment>
    );
  }
}

export default App;
